■商品内容<br>
サイズ：約10*19ミリ　厚み：約5ミリ　ホール：約1.5ミリ<br>
※天然石の為、サイズ、色、形には個体差がございます。ご了承ください。<br>
カラー 　写真をご参考ください。<br>
素材：天然石（アメジスト・ローズクォーツ・タイガーアイ・ブルーレースアゲート・イーグルアイ）<br>
数量：2個　<br>
天使の羽の形をした天然石のビーズです。<br>他の天然石と組み合わせてストラップにしたり、ピアスにするのもおすすめ。<br>メタルビーズとも相性が良いので、アレンジの幅が広いアイテムです♪<br><br>
<br>
※天然由来および加工時に発生した傷・ヒビ・欠けなどが含まれている場合があります。
予めご了承ください。<style type="text/css">
